import React, { useState } from 'react';
import ProductList from '../components/ProductList';
import AddedProductList from '../components/AddedProductList';

const ProductsPage = () => {
  const [showAddedProducts, setShowAddedProducts] = useState(false);

  return (
    <div>
      <h1 className="text-2xl font-bold mb-4">Products</h1>
      <div className="mb-4">
        <button
          className={`px-4 py-2 mr-2 ${!showAddedProducts ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
          onClick={() => setShowAddedProducts(false)}
        >
          API Products
        </button>
        <button
          className={`px-4 py-2 ${showAddedProducts ? 'bg-blue-500 text-white' : 'bg-gray-200'}`}
          onClick={() => setShowAddedProducts(true)}
        >
          Added Products
        </button>
      </div>
      {showAddedProducts ? <AddedProductList /> : <ProductList />}
    </div>
  );
};

export default ProductsPage;
